def plotTripleBB(pairs1, pairs2, pairs3, xlabel, ylabel):
    xs1 = [x[0] for x in pairs1]
    ys1 = [x[1] for x in pairs1]
    xs2 = [x[0] for x in pairs2]
    ys2 = [x[1] for x in pairs2]
    xs3 = [x[0] for x in pairs3]
    ys3 = [x[1] for x in pairs3]
    plt.scatter(xs1, ys1, color='red', label='Length 2 BB')
    plt.scatter(xs2, ys2, color='blue', label='Length 4 BB')
    plt.scatter(xs3, ys3, color='green', label='Length 6 BB')
    plt.xlabel(xlabel)
    plt.ylabel(ylabel)
    plt.legend(loc='upper left')
    plt.show()

