def plotBarsBB(pairs1, pairs2, pairs3, pairs4, pairs5, xlabel, ylabel):
    p1time = sum([x[1] for x in pairs1])
    p2time = sum([x[1] for x in pairs2])
    p3time = sum([x[1] for x in pairs3])
    p4time = sum([x[1] for x in pairs4])
    p5time = sum([x[1] for x in pairs5])
    bblengths = [1, 2, 3, 4, 5]
    labels = ['4%', '16%', '36%', '64%', '100%']
    plt.bar(bblengths, [p1time, p2time, p3time, p4time, p5time])
    plt.xlabel(xlabel)
    plt.ylabel(ylabel)
    plt.xticks(bblengths, labels)
    plt.show()

