def plotSingle(pairs, title, xlabel, ylabel):
    xs = [x[0] for x in pairs]
    ys = [x[1] for x in pairs]
    plt.scatter(xs, ys, color='red', label=title)
    plt.xlabel(xlabel)
    plt.ylabel(ylabel)
    plt.legend(loc='upper left')
    plt.show()

